const url="https://api.allorigins.win/raw?url="+encodeURIComponent("https://stats.minecraftservers.org/data/540862");async function getServerData(){Plotly.purge("plot");const t=$("#plot").data("height");try{const e=await fetch(url,{method:"GET"});if(!e.ok)throw new Error(`Error! status: ${e.status}`);const a=await e.json();let o={x:a.online[1].data.map(t=>new Date(t[0])),y:a.online[1].data.map(t=>t[1]),name:"This Week",type:"line",line:{color:"#33FF00"}},n=[{x:a.online[0].data.map(t=>new Date(t[0])),y:a.online[0].data.map(t=>t[1]),name:"Last Week",type:"line",visibility:"hidden",line:{color:"#A9A9A9"}},o],r={autosize:!0,height:t,font:{size:10,color:"white"},plot_bgcolor:"transparent",paper_bgcolor:"transparent",xaxis:{title:"weekday",nticks:7,tickformat:"%A"},yaxis:{title:"players"},legend:{orientation:"h",yanchor:"bottom",y:1.02,xanchor:"right",x:1},margin:{l:50,r:50,b:50,t:50,pad:4}};Plotly.newPlot("plot",n,r,{responsive:!0}),window.setTimeout(getServerData,6e5)}catch(t){console.log(t)}}$(document).ready(function(){getServerData()});